La mer Baltique est une mer intracontinentale et intérieure de 364 800 km2 située dans le Nord de l'Europe et reliée à l'océan Atlantique par la mer du Nord. Elle communique au sud-ouest avec la mer du Nord par le Cattégat et le Skagerrak. Trois golfes principaux intègrent cet espace : le golfe de Botnie au nord, le golfe de Finlande à l'est et le golfe de Riga au sud-est. Les pays riverains sont : 
* la Suède à l'ouest et au nord ; 
* la Finlande au nord-est ; 
* la Russie (par le golfe de Finlande) et l'Estonie à l'est ; 
* la Lettonie au sud-est ; 
* la Lituanie, la Russie (à Kaliningrad) et la Pologne au sud ; 
* l'Allemagne et le Danemark au sud-ouest. Ces pays riverains, ainsi que la mer proprement dite, font l'objet, depuis 2009, d'une « stratégie de la Commission européenne en faveur du développement de la région de la mer Baltique », incluant un effort de dépollution de la Baltique et un système commun de surveillance maritime.
